(1, 'Avatar : The Way Of Water', 'Avatar:  The Way of Water is a 2022 American epic science fiction film directed by James Cameron from a screenplay he co-wrote with Rick Jaffa and Amanda Silver, with a story the trio wrote with Josh Friedman and Shane Salerno. Produced by Lightstorm Entertainment and TSG Entertainment, and distributed by 20th Century Studios, it is the sequel to Avatar (2009) and the second film in the Avatar franchise. Cast members Sam Worthington, Zoe Salda√±a, Stephen Lang, Joel David Moore, CCH Pounder, Giovanni Ribisi, Dileep Rao, and Matt Gerald reprise their roles from the original film, with Sigourney Weaver returning in a different role.[6] New cast members include Kate Winslet, Cliff Curtis, Edie Falco, and Jemaine Clement. In the film, Jake Sully (Worthington) and his family, under renewed threat from humans, seek refuge from the Metkayina clan of Pandora.', );
INSERT INTO `films` (`film_id`, `film_title`, `film_plot`, `film_poster`) VALUES
(2, 'Top Gun : Maverick', 'Top Gun: Maverick is a 2022 American action drama film directed by Joseph Kosinski and written by Ehren Kruger, Eric Warren Singer, and Christopher McQuarrie from a story by Peter Craig and Justin Marks. The film is a sequel to the 1986 film Top Gun. Tom Cruise reprises his starring role as the naval aviator Maverick. It was based on the characters of the original film created by Jim Cash and Jack Epps Jr.. The film also stars Val Kilmer, Miles Teller, Jennifer Connelly, Jon Hamm, Glen Powell, Lewis Pullman, and Ed Harris. In the film, Maverick confronts his past while training a group of younger Top Gun graduates, including the son of his deceased best friend, for a dangerous mission.', );
INSERT INTO `films` (`film_id`, `film_title`, `film_plot`, `film_poster`) VALUES
(3, 'King Otto', 'King Otto: In the summer of 2004, audiences looked on in disbelief as the Greek National Football Team, a country that had never previously won a single match in a major tournament, took down the giants of world football to become the unlikeliest of European Champions.\r\n\r\nThe architect behind this unprecedented triumph was legendary German football coach \'King\' Otto Rehhagel. After accomplishing every major success in Germany, he made the bold decision to leave all he knew behind and work in a foreign country with the underachieving Greek National Team.\r\n\r\nThis is the story of how these two contrasting cultures came together to speak the same language and write a new chapter of Greek mythology.', );

